import './App.css';
import { BrowserRouter as Router } from 'react-router-dom';
import Home from './components/Home';
import About from './components/About';
import Shop from './components/Shop';


function App() {
  return (
   <>
      <Router  path="/" exact>
        <Home />
      </Router>
      <Router path="/about">
        <About/>
      </Router>
      <Router path="/shop">
        <Shop />
      </Router>
   </>
  );
}

export default App;
